import { Route, Routes, useNavigate } from "react-router-dom";
import Home from "./Home.tsx";
import CreateTxn from "./CreateTxn.tsx";
import History from "./History.tsx";
import Button from "@mui/material/Button";

function Main() {
  const navigate = useNavigate();

  return (
    <div className="content">
      <Button variant="text" className="ez" onClick={() => navigate("/")}>
        Home
      </Button>
      <Button variant="text" onClick={() => navigate("/create")}>
        New Transaction
      </Button>
      <Button variant="text" onClick={() => navigate("/history")}>
        Transaction History
      </Button>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/create" element={<CreateTxn />} />
        <Route path="/history" element={<History />} />
      </Routes>
    </div>
  );
}

export default Main;
